import collections
"""
collections模块：
    1.namedtuple是一个函数，它用来创建一个自定义的tuple对象，并且规定了tuple元素的个数，并可以用属性而不是索引来引用tuple的某个元素。
    2.deque是为了高效实现插入和删除操作的双向列表，适合用于队列和栈。deque除了实现list的append()和pop()外，还支持appendleft()和popleft()。
    3.在Key不存在时返回默认值，defaultdict的其他行为跟dict是完全一样的。
    4.OrderedDict的Key会按照插入的顺序排列，不是Key本身排序。rderedDict可以实现一个FIFO（先进先出）的dict，当容量超出限制时，先删除最早添加的Key。
    5.Counter计数
    6.ChainMap可以把一组dict串起来并组成一个逻辑上的dict。ChainMap本身也是一个dict，但是查找的时候，会按照顺序在内部的dict依次查找。
"""

class Solution:
    def canConstruct(self, ransomNote: str, magazine: str) -> bool:
        # magazineCount=dict()
        # for item in magazine:
        #     magazineCount[item]=magazine.count(item)
        # for item in ransomNote:
        #     if item in magazineCount.keys():
        #         magazineCount[item]-=1
        #         if magazineCount[item]<0:
        #             return False
        #     else:
        #         return False
        # return True
        ransom_count = collections.Counter(ransomNote)
        magazine_count = collections.Counter(magazine)
        return ransom_count & magazine_count == ransom_count





